export default class APIService{
    static UpdateWorkout(workout_id, body){
        console.log(workout_id, body)
        return fetch(`http://127.0.0.1:8000/api/articles/${workout_id}/`, {
            'method':'PUT',
            headers: {
                'Content-Type':'application/json',
            }, 
            body:JSON.stringify(body)

        }).then(resp => resp.json())
    }
}
